import React from 'react';
import {connect} from 'react-redux';
import {withRouter} from 'react-router-dom';
import {createStructuredSelector} from 'reselect';
import {selectShopByCategory} from './../../redux/shop-reducer/shop.selectors';
// import CollectionItem from './../../components/collection-item/collection-item.component';
import './category.styles.scss';

const CategoryPage = ({match, collections}) => {
    console.log(match);
    console.log(collections);
    return (
        <div className="category">
            CATEGORY PAGE AFTER NESTED ROUTING
        </div>
    )
}

const mapStateToProps = createStructuredSelector({
    collections: selectShopByCategory
})

export default withRouter(connect(mapStateToProps, null)(CategoryPage));
